import photo from './myself.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div classname="image-background">
          HELLO
        <img src={myself} className="myself" alt="myself" />
        </div>
        
      </header>
    </div>
  );
}

export default App;
